import React from 'react';
import './style.css';

const Landing = () => (
    <section class="home-header">
        <h1>Welcome to BlueAthlete</h1>
        <button class="big-button">Login for Students</button>
        <button class="big-button">Login for Coach</button>
    </section>
);

export default Landing;
